import React from 'react';
import PropTypes from 'prop-types';
// import Dummy from '../ui/dummys/Dummy';
import Button from 'ui/buttons/Button';
import SelectMonth from 'ui/form/SelectMonth';
import SelectYear from 'ui/form/SelectYear';
import SVGPrevious from 'ui/svg/Previous';
import SVGNext from 'ui/svg/Next';
import styles from './calendar.scss';
import DaysOfWeek from 'ui/daysOfWeek/DaysOfWeek';


/**
 * General component description in JSDoc format. Markdown is *supported*.
 */

var test =  '';

console.log( test );

const Calendar = ( optionsState ) => (
    <div>
        Calendar
        <div>
            <Button text="Month"  />
            <Button text="Week" />
            <Button text="Day" />
        </div>

        <div>  <SelectMonth

        />
        <option value="0">January</option>
        <option value="1">February</option>
        <option value="2">March</option>
        <option value="3">April</option>
        <option value="4">May</option>
        <option value="5">June</option>
        <option value="6">July</option>
        <option value="7">August</option>
        <option value="8">September</option>
        <option value="9">October</option>
        <option value="10">November</option>
        <option value="11">December</option>
        <SelectYear /></div>


        <SVGPrevious width={20} height={10}/>
        <Button text="Previous"/>
        <Button text="Next" />
        <SVGNext  width={20} height={10}/>
        <DaysOfWeek />

    </div>


);


Calendar.propTypes = {
    /** Description of prop "text". */
    text: PropTypes.string,
    optionsState: PropTypes.string


};

Calendar.defaultProps = {
    text: 'defaultText'


};

export default Calendar;
